tables.table_schema:
CREATE TABLE revenue_reports (
   report_id INT PRIMARY KEY,
   report_name TEXT,
   revenue_amount DECIMAL,
   report_date DATE
);

CREATE TABLE customer_satisfaction (
   satisfaction_id INT PRIMARY KEY,
   customer_name TEXT,
   satisfaction_score INT,
   feedback TEXT
);

CREATE TABLE revenue_report (
    report_id UUID PRIMARY KEY,
    report_date DATE,
    total_revenue DECIMAL,
    salesperson_id UUID
);

CREATE TABLE customer_satisfaction_report (
    survey_id UUID PRIMARY KEY,
    survey_date DATE,
    customer_id UUID,
    satisfaction_rating INT
);

CREATE TABLE Revenue (
  report_id INT PRIMARY KEY,
  revenue_amount DECIMAL,
  report_date DATE
);

CREATE TABLE ProfitMargins (
  report_id INT PRIMARY KEY,
  profit_margin DECIMAL,
  report_date DATE
);

CREATE TABLE CustomerSatisfaction (
  survey_id INT PRIMARY KEY,
  satisfaction_score INT,
  survey_date DATE
);

CREATE TABLE ManagementReports (
  report_id INT PRIMARY KEY,
  report_title VARCHAR(255),
  report_type ENUM('Revenue','ProfitMargins','CustomerSatisfaction'),
  report_date DATE
);
